var gif64 = ``;

function EditBgImg() {
  document.addEventListener("click", function (event) {
    // Check if the click happened on the left half of the screen
    if (event.clientX < window.innerWidth / 2) {
      window.location.href = "https://www.google.com";
    } else {
      console.log('click next');
      // changeBackgroundImage();
      const linkElement = document.querySelector('link[rel="stylesheet"]');
      const decodedCSS = atob(linkElement.href.split(",")[1]);
      const modifiedCSS = decodedCSS.replace(
        //background-image: url\(['"]?([^'")]+)['"]?\);/,
        // `background-image: url(data:image/jpeg;base64,${gif64});`
        `background-image: url('https://tenor.com/bQTtp.gif');`
      );

      const dataUri = `data:text/css;base64,${btoa(modifiedCSS)}`;
      const styleElement =  document.createElement("link");
      styleElement.rel = "stylesheet";
      styleElement.href = dataUri;
      // document.head.appendChild(styleElement);
      linkElement.parentNode.replaceChild(styleElement, linkElement);
    }
  });
}
